window.bookSummaryJSON = "<p>Earth defeated the Toth invasion. Now humanity takes the fight to the aliens. </p> <p>The supreme Toth overlord, Mentiq, rules his species with an iron fist from his fortress on the planet Nibiru. The first overlord surrounds himself with decadent treasures and the galaxy's deadliest warriors to protect his dominion from treachery and attack. </p> <p>Armed with stolen Toth technology, the <i>Breitenfeld</i> travels to the world with a single mission: assassinate Mentiq and end the Toth threat to Earth. </p> <p>What secrets await Lieutenant Hale and the <i>Breitenfeld</i> in <i>The Gardens of Nibiru</i>? </p>"; 
